import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';


export const Contexto= React.createContext();

export default function App() {
  
 
  

  return (
    <Contexto.Provider value={{notas}}>
        <View>
        <Text style={styles.texto}>nome</Text>
        <Text style={styles.texto}>n1</Text>
            <Text style={styles.texto}>n1</Text>
            <Text style={styles.texto}>n2</Text>
            <Text style={styles.texto}>n3</Text>
            <Text style={styles.texto}>n4</Text>
            <Text style={styles.texto}>Medias</Text>
        </View>
      
    
    </Contexto.Provider>
  );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20,
    },
    texto: {
        fontSize: 16,
        padding: 20,
        borderWidth: 1,
        margin: 10
    },
    text2: {
        fontSize: 20,
        padding: 10,
        marginTop: 20,
        flex: 1,

    },
});
